def borc_duzenle(request, musteri_id):
    if request.method == 'POST':
        tutar = Decimal(request.POST.get('tutar'))
        aciklama = request.POST.get('aciklama')
        islem = request.POST.get('islem')
        musteri = Musteri.objects.get(id=musteri_id)
        onceki_borc = musteri.borc
        print(tutar)
        print(aciklama)
        print(islem)
        print(onceki_borc)

        if islem == 'borcekle':
            musteri.borc += tutar
            aciklama = f'Borç eklendi - {aciklama}'
        elif islem == 'borcdus':
            musteri.borc -= tutar
            aciklama = f'Borç düştü - {aciklama}'
        musteri.save()
        print(aciklama)
        BorcHareketi.objects.create(musteri=musteri, tutar=tutar, aciklama=aciklama, onceki_borc=onceki_borc)
        return redirect('musteri-listesi')



